## Available Tools

{
  "tool_call_structure": {
    "description": "Tool call request from LLM (proposal phase).\n\nThis is what the LLM returns - pure JSON-serializable data for validation.",
    "properties": {
      "description": {
        "description": "Past-tense description of what this action does (e.g., 'Clicked the cart icon', 'Filled quantity field with 2')",
        "type": "string"
      },
      "tool": {
        "description": "Tool name to execute",
        "type": "string"
      },
      "parameters": {
        "additionalProperties": true,
        "description": "Tool-specific parameters",
        "type": "object"
      }
    },
    "required": [
      "description",
      "tool"
    ],
    "type": "object"
  },
  "available_tools": [
    {
      "tool": "complete_subtask",
      "description": "Signal that the current subtask was successfully completed and all requirements were met",
      "parameters": {
        "feedback": {
          "description": "What was accomplished and how requirements were met",
          "type": "string"
        }
      },
      "required": [
        "feedback"
      ]
    },
    {
      "tool": "request_reschedule",
      "description": "Signal that the current subtask could not be completed and Manager needs to reschedule/replan (e.g., subtask failed, wrong approach, blocker encountered, unclear goal)",
      "parameters": {
        "feedback": {
          "description": "Explanation of why reschedule is needed - what went wrong, what was tried, what blocked progress",
          "type": "string"
        }
      },
      "required": [
        "feedback"
      ]
    },
    {
      "tool": "request_correction",
      "description": "Request Worker to make corrections to fix issues (use when fixable without replanning)",
      "parameters": {
        "feedback": {
          "description": "What needs to be corrected and how to fix it",
          "type": "string"
        }
      },
      "required": [
        "feedback"
      ]
    },
    {
      "tool": "wait",
      "description": "Wait for specified seconds (useful after actions that trigger page changes, modals, or dynamic content loading)",
      "parameters": {
        "seconds": {
          "description": "Seconds to wait (max 10)",
          "maximum": 10.0,
          "minimum": 0.1,
          "type": "number"
        }
      },
      "required": [
        "seconds"
      ]
    }
  ]
}

